import { StyledCollapsible } from '../style/collapsible.styled'
import { Collapsible } from './collapsible'

function FetchData() {
	// Select the DOM-element, so that you can replace it with content
	let PROJECT_ID = 'oans3nsr'
	let DATASET = 'production'
	let QUERY = encodeURIComponent('*[_type == "bedrift"]')

	// Compose the URL for your project's endpoint and add the query
	let URL = `https://${PROJECT_ID}.api.sanity.io/v2021-10-21/data/query/${DATASET}?query=${QUERY}`

	// fetch the content
	fetch(URL)
		.then((res) => res.json())
		.then(({ result }) => {
			console.log(result)
			// get the list element, and the first item
			const list = document.querySelector('ul')
			console.log(list, 'ok')
			let firstListItem = document.querySelector('li')
			// console.log(firstListItem, 'ok')

			if (result.length > 0) {
				// remove the placeholder content
				list.removeChild(firstListItem)

				result.forEach((bedrift) => {
					// create a list element for each company
					const listItem = document.createElement('li')

					// add the company name as the text content
					listItem.textContent = bedrift.name
					console.log(listItem, 'ok')

					// add the item to the list
					list.appendChild(listItem)
					listItem.append(<StyledCollapsible />)

				})
			}
		})
	return (
		<ul>
			<li>
				<p>Company loading</p>
			</li>
		</ul>
	)
}

export default FetchData
